import Link from 'next/link'

export default function Navbar() {
  const styles = {
    display: 'flex',
    background: 'grey',
    alignItems: 'space-between',

  }

  return (
    <div style={styles}>
      <Link href='/about'><a>about</a></Link>
      <h1>Our Navbar</h1>
    </div>
  )
}
